var b="url",c="پروفایل_کارجویان_واحد_جذب_و_استخدام_.html",d="generationDate",e=new Date(1764584718150.19),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="Loginv",t="page",u="packageId",v="39db7d11c313438a8f00f1c6de31d4aa",w="type",x="Axure:Page",y="پروفایل کارجویان(واحد جذب و استخدام)",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="3932d1a65db04e6b9cea83145c2b146e",F="label",G="ارجاع رزومه",H="Note",I="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">تنها رزومه(پروفایل) هایی از کارجویان امکان ارجاع به دریافت کننده رزومه(درخواست کننده سرمایه انسانی) را داشته باشند که در وضعیت &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#13B015;\">تایید</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; قرار داشته باشند و همچنین با عنوان شغلی لینک شده باشند در غیر اینصورت کاربر در هنگام ارجاع رزومه با پیام خطایی مبنی بر اینکه </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">رزومه ای که قصد ارجاع آن را دارید در وضعیت تایید قرار ندارد؛&nbsp; شما قادر به ارجاع آن نیستید در صورت تمایل به ارجاع رزومه خواهشمند است رزومه(پروفایل) کارجو را به وضعیت &quot; تایید &quot; ببرید</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#3800FF;\">توجه گردد تا قبل از ارجاع رزومه(پروفایل)، کاربر قادر باشد تا وضعیت رزومه را تغییر دهد اما با ارجاع رزومه، وضعیت رزومه در مرحله &quot;تایید&quot; </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">قفل </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#3800FF;\">گردیده و کاربر دیگر قادر به تغییر وضعیت رزومه نباشد</span></p>",J="2",K="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در هنگام ارجاع رزومه(پروفایل) از طرف واحد جذب و استخدام به دریافت کننده رزومه جهت بررسی و اعلام نظر چنانچه مرحله &quot;ثبت نام تکمیلی&quot; توسط کارجو انجام شده باشد رزومه تکمیل شده در مرحله ثبت نام تکمیلی برای دریافت کننده رزومه ارسال گردد در غیر اینصورت رزومه اولیه ای که کارجو در هنگام ثبت نام و ایجاد پروفایل در سامانه فرصت های شغلی ایجاد نموده است جهت بررسی و اعلام نظر بر روی رزومه برای&nbsp; دریافت کننده رزومه ارسال گردد</span></p>",L="3",M="a0a52bdeb5f9481c952fe8ac7e9e3cc3",N="مشاهده",O="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">امکان مشاهده مهارت/نرم افزار های کارجو(در صورت ورود توسط کارجو) از طریق یک فرم مدال قابل مشاهده باشد</span></p>",P="4",Q="f5ad3035a78a4cb6be32e86ec9669c81",R="(Shape)",S="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">امکان مشاهده پروفایل کارجو وجود داشته باشد </span></p>",T="5",U="f1743839751b45adb41fca4730313056",V="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">پروفایل کارجویان قابلیت دانلود نمودن سیستمی داشته باشد.نام فایل دانلود شده با نام و نام خانودگی صاحب پروفایل ذخیره گردد</span></p>",W="6",X="3f051fdd10584c23ac75601896e2d510",Y="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">امکان نشان نمودن پروفایل کارجو وجود داشته باشد</span></p>",Z="7",ba="bbd82f95f4534512be1589cc1b264aa1",bb="ت و-رزومه(ج و ا)",bc="<p><span style=\"font-family:'2  Yekan Bold', '2  Yekan Regular', '2  Yekan', sans-serif;font-weight:700;\">ت و-رزومه(ج و ا)</span></p><p><span style=\"font-family:'2  Yekan', sans-serif;font-weight:400;color:#F9F9F9;\">ت و-</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#88175B;\">تعیین وضعیت رزومه(پروفایل) توسط جذب و استخدام</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF2BAA;\">پروفایل </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#88175B;\">= </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">رزومه ای اولیه ای که کارجو حین ثبت نام در سامانه های فرصت های شغلی تکمیل نموده است</span></p>",bd="8",be="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">تغییر وضعیت رزومه(پروفایل) از طریق یک فرم مدال با وضعیت های زیر جهت واحد جذب و استخدام امکانپذیر باشد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">در صف مشاهده</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">مشاهده</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">تایید</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">عدم تایید</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">استفاده در آینده</span></p>",bf="9",bg="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#191B9F;\">تعیین وضعیت کارجو یک &quot;اکشن&quot; می باشد که توسط واحد جذب و استخدام جهت تعیین وضعیت رزومه(پروفایل) کارجو مورد استفاده قرار می گیرد نحوه پیاده سازی این &quot;اکشن&quot; می تواند مانند نحوه پیاده سازی اکشن &quot;ارجاع رزومه&quot; با انتخاب رزومه کارجو و سپس تعبیه کلیدی مانند &quot;ارجاع&quot; با عنوان &quot;تعیین وضعیت رزومه&quot; باشد</span></p>",bh="10",bi="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">در صورت تغییر وضعیت رزومه توسط مدیر جذب و استخدام، وضعیت رزومه از طریق بخش &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0404;\">اعلان(زنگوله)</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">&quot; در فرم &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0404;\">مشاهده فرصت های شغلی(آگهی های استخدام)</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">&quot; در پروفایل کارجو به وی اطلاع رسانی گردد تا کارجو از وضعیت رزومه(پروفایل) خود مطلع گردد</span></p>",bj="11",bk="eb6e6c26d54149fab6009b31d1ed3566",bl="(Droplist)",bm="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چنانچه رزومه(پروفایل) کارجو به مرحله &quot;تایید&quot; رفت یک پیامک به محتوای زیر برای شماره تلفن همراه کارجو ارسال گردد:</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">-------------------------</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#6D000E;\">کارجوی گرامی، رزومه شما مورد بررسی قرار گرفت، خواهشمند است در اسرع وقت جهت ادامه فرایند از طریق لینک زیر اطلاعات خود را تکمیل نمایید </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#6D000E;\">لینک: https://employ.sgpco.com/Employ/#/</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#6D000E;\">تکمیل رزومه هیچگونه تعهد </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#6D000E;\">استخدام برای شرکت ایجاد نخواهد کرد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">-------------------------</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">&nbsp;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#0000BF;\">**</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">امکان ویرایش متن پیامک قبل از ارسال جهت کارجو&nbsp; برای مدیر جذب و استخدام وجود داشته باشد</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">**</span></p>",bn="12",bo="7d9ad00c6d8742c0b08c771ebdbd5e98",bp="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که کاربر از طریق این گزینه برای اولین بار رزومه ارسال شده توسط کارجو را مشاهده نمود وضعیت رزومه کارجو از وضعیت &quot;در صف مشاهده&quot; به صورت اتوماتیک به وضعیت &quot;مشاهده شده&quot; برود.البته کاربر قادر باشد وضعیت را در صورت تمایل مجددا به &quot;در صف مشاهده&quot; تغییر دهد</span></p>",bq="13",br="4cd340277cf742e3acf34f3ed4e22d4e",bs="ذخیره",bt="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با هر تغییری که در &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">وضعیت رزومه</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; یا &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">نشان کردن</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; توسط کاربر انجام می گردد گزینه &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">ذخیره</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; اجباری گردد.در صورت عدم فشردن کلید ذخیره و قصد کاربر برای بستن فرم به کاربر هشداری مبنی بر عدم ذخیره تغییرات ایجاد&nbsp; شده داده شود</span></p>",bu="14",bv="dc29a00ca7d944d18f406cbfda334ba5",bw="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که رزومه کارجو برای اولین بار مشاهده گردید و رزومه به وضعیت &quot;مشاهده شده&quot; تغییر وضعیت داد در دفعات بعدی که رزومه مجددا مشاهده می گردد وضعیت رزومه بر روی آخرین وضعیتی که گرفته است قرار گیرد</span></p>",bx="15",by="381a1ffa8be543b69385644d5398c43f",bz="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چنانچه رزومه کارجو به مرحله &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#4B7902;\">تایید</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; رفت دکمه &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#A408BF;\">ثبت نام تکمیلی</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; که حاوی لینک ثبت نام میشود در قسمت ا</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">ز طریق بخش &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0404;\">اعلان(زنگوله)</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">&quot; در فرم &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0404;\">مشاهده فرصت های شغلی(آگهی های استخدام)</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">&quot; در </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">پروفایل کارجو نمایش داده شده و فعال گردد.کارجو سپس با استفاده از این دکمه قادر باشد پس از احراز </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">هویت به ثبت نام تکمیلی خود بپردازد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">پس از پایان ثبت نام تکمیلی و دریافت کد رهگیری توسط کارجو &quot;کد رهگیری&quot; دریافت شده نیز در</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\"> بخش &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0404;\">اعلان(زنگوله)</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">&quot; در فرم &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0404;\">مشاهده فرصت های شغلی(آگهی های استخدام)</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#333333;\">&quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"> در پروفایل کارجو نمایش داده شود.کارجو تا قبل از مرحله &quot;ضمیمه مدارک&quot; قادر باشد تا ثبت نام تکمیلی خود را ویرایش نماید</span></p><p><span><br></span></p>",bA="16",bB="fdc1a2921cde4c9aab162b2c26d49924",bC